import React from 'react'
import plusIcon from '../../assets/plus.png'
import './sidebar.css'

export default function Sidebar() {
  return (
    <>
      <div className="sidebar_main">
        <img src={plusIcon} alt="plus" />
      </div>
    </>
  )
}
